import React, { Component } from 'react';
import Button from 'react-bootstrap/Button'
import {Link} from 'react-router-dom'

class HeaderNav extends Component {
    constructor(props){
        super(props);
    }

    render(){
        return (
            <div style={{color:'black', marginTop:"9.8vh", marginRight:"15vh", textAlign:"right", justifyContent:"right", alignItems:"right"}}>
                <Button variant="Link" style={{color:"black"}}>
                    <Link to="/home/" style={{color:"black"}}>Home</Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to={{pathname:"/short_films/",type:"short_films"}} style={{color:"black"}}>Short Films</Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/concept_design/" style={{color:"black"}}>Concept Design</Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/illustration/" style={{color:"black"}}>Illustration</Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/drafting/" style={{color:"black"}}>Drafting</Link>
                </Button>
                <Button variant="Link" style={{color:"white"}}>
                    <Link to="/architecture/" style={{color:"black"}}>Architecture</Link>
                </Button>
                <Button variant="Link" style={{color:"black"}}>
                    <Link to="/resume/" style={{color:"black"}}>Resume</Link>
                </Button>
            </div>
        );
    }
};

export default HeaderNav;
